``` C++
class Solution {
public:
    vector<int> addToArrayForm(vector<int>& num, int k) {
        vector<int> ans;
        int n = num.size() - 1;
        int flag = 0;
        while(n >= 0 || k != 0){
            int a = n < 0 ? 0 : num[n];
            int b = k != 0 ? (k % 10) : 0;
            int tmp = a + b + flag;
            ans.push_back(tmp % 10);
            flag = tmp / 10;
            --n; k/=10;
        }
        if(flag != 0){
            ans.push_back(flag);
        }
        reverse(ans.begin(), ans.end());
        return ans;
    }
};

```

****
- : O(max(n,len(k)),nnum, len(k)k
- O(n), nans

