var addToArrayForm = function (num, k) {

    let answer = []; 
    let carry = 0; // 
    for (let i = 1; i <= num.length || k >= 1; i++) {
        let num1 = num.length - i >= 0 ? num[num.length - i] : 0;
        let num2 = k % 10;
        let sum = num1 + num2 + carry; //
        if (sum >= 10) { 
            answer.unshift(sum % 10);
            carry = Math.floor(sum / 10)
        } else {
            answer.unshift(sum)
            carry = 0
        }
        k = Math.floor(k / 10)
    }
    if (carry !== 0) { // 0
        answer.unshift(carry)
    }
    return answer;
};
