class Solution {
public:
    vector<int> addToArrayForm(vector<int>& num, int k) {
        vector<int> res;
        int n = num.size();
        for(int i = n-1;i >= 0;i--)
        {
            int temp = num[i] + k % 10;
            k /= 10;
            if(temp >= 10)
            {
                k++;
                temp -= 10;
            }
            res.push_back(temp);
        }
        while(k > 0)
        {
            res.push_back(k % 10);
            k /= 10;
        }
        reverse(res.begin(), res.end());
        return res;
    }
};
```

