w-curiosity.body:
### 
traverse each digit of the `num` and `k` in reverse order and do add operation
reverse the list and return

### 


```java
class Solution {
    public List<Integer> addToArrayForm(int[] num, int k) {
        int carry = 0;
        int p = num.length - 1;
        List<Integer> list = new LinkedList<>();
        while( p >= 0 || k > 0 || carry > 0) {
            int cur = k % 10 + carry;
            if(p >= 0) {
                cur += num[p];
                p--;
            }
            list.add(cur % 10);
            carry = cur / 10;
            k = k / 10;
        }
        Collections.reverse(list);
        return list;
    }
}


```

****
- TC = O(max(M,N)), M is the length of num, N is the numbers of digits of k
- SC = O(1), use constant space

