class Solution {
    //  k  lastOfk
    //  num  lastOfNum
    //  sum(lastOfNum + lastOfk + flag) 101 sum(lastOfNum + lastOfk + flag) % 10  res 
    //  sum(lastOfNum + lastOfk + flag) 10 0 sum(lastOfNum + lastOfk + flag) % 10  res 
    //  num, k flag 0
    public List<Integer> addToArrayForm(int[] num, int k) {
        LinkedList<Integer> res = new LinkedList<>();
        // k
        int index = num.length - 1; // num 
        int flag = 0; // 
        int lastOfNum = 0;
        int lastOfk = 0;
        int sum = 0;
        while (k > 0 && index >= 0) {
            lastOfk = k % 10;
            k /= 10;
            lastOfNum = num[index--];
            sum = lastOfk + lastOfNum + flag;
            if (sum >= 10) {
                flag = 1;
                res.addFirst(sum % 10);
            } else {
                flag = 0;
                res.addFirst(sum);
            }
        }

        while (k > 0) {
            lastOfk = k % 10;
            k /= 10;
            sum = lastOfk + flag;
            if (sum >= 10) {
                flag = 1;
                res.addFirst(sum % 10);
            } else {
                flag = 0;
                res.addFirst(sum);
            }

        }

        while (index >= 0) {
            lastOfNum = num[index--];
            sum = lastOfNum + flag;
            if (sum >= 10) {
                flag = 1;
                res.addFirst(sum % 10);
            } else {
                flag = 0;
                res.addFirst(sum);
            }
        }

        if (flag == 1) {
            res.addFirst(1);
        }

        return res;
    }
}
```

